	District.countries  = [];
	District.chinaProvs = [];
	District.data       = [];
	District.init       = function() {
		if (District.data.length) {
			return;
		}
		
		var row, col, c;
		for (row = col = c = 0; c < District.content.length; c++) {
			var char =  District.content[c], nextchar =  District.content[c+1];
			District.data[row] = District.data[row] || [];
			District.data[row][col] = District.data[row][col] || '';
			
			if (char == ',') {
				++col; 
				continue;
			}

			if (char == ';') {
				if (District.data[row][3] == 1) {
					District.chinaProvs.push(District.data[row]);
				}
				
				++row;
				col = 0;
				continue;
			}

			District.data[row][col] += char;
		}
	}

	function doEvent(element, event) {
	    if (document.createEventObject) {
	    // dispatch for IE
	    	var evt = document.createEventObject();
	    	return element.fireEvent('on'+event,evt)
	    } else {
		    // dispatch for firefox + others
		    var evt = document.createEvent("HTMLEvents");
		    evt.initEvent(event, true, true ); // event type,bubbling,cancelable
		    return !element.dispatchEvent(evt);
	    }
	}

	District.prototype = {
		_init: function() {
			District.init();
		},
		
		loadProvs: function() {
			if (!this.prov) {
				alert('省份选择框ID未定义');
				return false;
			}
			
			var index = this.prov.options.length;
			for(var i=0; i < District.chinaProvs.length; i++) {
				this.prov.options[index] = new Option(District.chinaProvs[i][1], District.chinaProvs[i][2]);
				index++;
			}

			var that = this;
			if (this.city) {
				this.prov.onchange = function() {
					that.resetCities();
					that.resetDists();
					that.loadCities();
				}
			}
			this.afterLoadProvs();
		},
		
		loadCities: function() {
			if (!this.prov.value) {
				return;
			}
			
			var code = this.prov.value.substr(0, 2);
			var index = this.city.options.length;
			for(var i=0; i < District.data.length; i++) {
				if (District.data[i][2].substr(0, 2) == code && District.data[i][3] == 2) {
					this.city.options[index] = new Option(District.data[i][1], District.data[i][2]);
					index++;
				}
			}

			var that = this;
			if (this.dist) {
				this.city.onchange = function() {
					that.resetDists();
					that.loadDists();
				}
			}

			this.afterLoadCities();
		},
		
		loadDists: function() {
			if (!this.dist) {
				return;
			}

			if (!this.city.value) {
				return;
			}

			var code = this.city.value.substr(0, 4);
			var index = this.dist.options.length;
			for(var i=0; i < District.data.length; i++) {
				if (District.data[i][2].substr(0, 4) == code && District.data[i][3] == 3) {
					this.dist.options[index] = new Option(District.data[i][0], District.data[i][2]);
					index++;
				}
			}
			this.afterLoadDists();
		},

		finishing: function(code) {
			if (this.prov.options.length <= 2) {
				this.loadProvs();
			}
			
			if (!code) {
				return;
			}
			
			var foundProv    = false;
			var foundCity    = false;
			if (this.prov) {
				for (var i=0; i<this.prov.options.length; i++) {
					if (this.prov.options[i].value.substr(0, 2) == code.substr(0, 2)) {
						this.prov.selectedIndex = i;
						if (this.city) {
							this.loadCities();
						}
						foundProv = true;
						break;
					}
				}
			}

			if (this.city && foundProv) {
				for (var i=0; i<this.city.options.length; i++) {
					if (this.city.options[i].value.substr(0, 4) == code.substr(0, 4)) {
						this.city.selectedIndex = i;
						if (this.dist) {
							this.loadDists();
						}
						foundCity = true;
						break;
					}
				}
			}
			
			if (this.dist && foundCity) {
				for (var i=0; i<this.dist.options.length; i++) {
					if (this.dist.options[i].value == code) {
						this.dist.selectedIndex = i;
						break;
					}
				}
			}
		},
		
		afterLoadCountries: function() {},
		afterLoadProvs: function() {},
		afterLoadCities: function() {},
		afterLoadDists: function() {},

		resetProvs: function() {
			if (!this.prov) {
				return;
			}
			this.reset(this.prov);
		},
		
		resetCities: function() {
			if (!this.city) {
				return;
			}
			this.reset(this.city);
		},

		resetDists: function() {
			if (!this.dist) {
				return;
			}
			this.reset(this.dist);
		},

		reset: function(obj) {
			var tmp = obj.options[0];
			obj.length = 0;
			obj.options[0] = tmp;
		}
	}
